import React,{useState,useEffect} from 'react'

const Fetching = (url) => {
    const[state,setstate] = useState({})
    useEffect(() =>{
        fetch(url).then(res =>res.json()).then(data =>setstate(data))
    })
  return {state}
    
}

export default Fetching;
